import React from 'react'
import {Grid} from 'semantic-ui-react'

const Recipes = props => (
    <Grid columns='three'>
        <Grid.Row>
            {props.recipes.map((recipe) => {
                return (
                    <Grid.Column>
                        <h2>{recipe.title}</h2>
                        <img src={recipe.img_url}/>
                    </Grid.Column>
                )
            })}
        </Grid.Row>
    </Grid>
)

export default Recipes
